    const randomWord = useSelector(storeState => storeState.randomWord);
    //do the API call, choose a random word and save in redux using dispatch in React.useEffect
    //get the word from redux using selector
    return (
        <div className="App">
            <p>Word</p>
        </div>
    );
}

export default Word;
